"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: H. pylori infection (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/h-pylori-infection-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H1480480751\">",
"      <span class=\"h1\">",
"       What is H. pylori infection?",
"      </span>",
"      &nbsp;&mdash;&nbsp;H. pylori infection is a condition that can sometimes cause pain in the upper belly, bloating, nausea, or vomiting.",
"     </p>",
"     <p>",
"      H. pylori infection occurs when a type of bacteria called H. pylori infects a person&rsquo;s stomach or duodenum. The duodenum is the first part of the small intestine (",
"      <a class=\"graphic graphic_figure graphicRef64960 \" href=\"UTD.htm?39/54/40804\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Many people have H. pylori infection. Most of the time, H. pylori infection does not lead to any problems or cause any symptoms.",
"     </p>",
"     <p>",
"      But in some people, H. pylori infection leads to problems that can cause symptoms. These problems can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Open sores, which are called &ldquo;ulcers,&rdquo; on the lining of a person&rsquo;s stomach or duodenum",
"       </li>",
"       <li>",
"        Stomach cancer",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Doctors do not know why H. pylori infection leads to problems in some people and not others.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1480480758\">",
"      <span class=\"h1\">",
"       What are the symptoms of H. pylori infection?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people with H. pylori infection have no symptoms. But people who have ulcers can have symptoms that are caused by the ulcers. Common symptoms of ulcers can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Pain in the upper belly",
"       </li>",
"       <li>",
"        Feeling bloated",
"       </li>",
"       <li>",
"        Feeling full after eating a small amount of food",
"       </li>",
"       <li>",
"        Not feeling hungry",
"       </li>",
"       <li>",
"        Nausea or vomiting",
"       </li>",
"       <li>",
"        Dark or black-colored bowel movements",
"       </li>",
"       <li>",
"        Feeling more tired than usual",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Not all ulcers are caused by H. pylori infection. For example, people can get ulcers from taking certain pain-relieving medicines. But if you have the symptoms listed above, let your doctor or nurse know.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1480480765\">",
"      <span class=\"h1\">",
"       Is there a test for H. pylori infection?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Doctors can do different tests to diagnose H. pylori infection. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood tests",
"       </li>",
"       <li>",
"        Breath tests &ndash; These tests measure substances in a person&rsquo;s breath after he or she has been given a special liquid to drink.",
"       </li>",
"       <li>",
"        Lab tests that check a sample of a bowel movement for H. pylori infection",
"       </li>",
"       <li>",
"        Biopsy &ndash; For this test, a doctor takes a small piece of tissue from the lining of the stomach. Then he or she looks at the tissue under a microscope. A doctor can do a biopsy during a procedure called an endoscopy. An endoscopy is a procedure that lets a doctor look at the inside lining of the esophagus, stomach, and duodenum.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1480480772\">",
"      <span class=\"h1\">",
"       Should I be tested for H. pylori infection?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You should be tested for H. pylori infection if you have symptoms and:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Have an ulcer in the stomach or duodenum",
"       </li>",
"       <li>",
"        Have had ulcers in the past",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Sometimes, doctors test people who have no symptoms for H. pylori infection if they have a family history of stomach cancer. Doctors also sometimes test people with symptoms who have never had an ulcer.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1480480779\">",
"      <span class=\"h1\">",
"       How is H. pylori infection treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;H. pylori infection is treated with medicines. Most people need to take 3 or more medicines for 1 to 2 weeks. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines to reduce the amount of acid that the stomach makes &ndash; This can help cure the infection and help ulcers heal.",
"       </li>",
"       <li>",
"        Different types of antibiotics",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People who are diagnosed with H. pylori infection should get treated, because treatment can:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Help ulcers heal",
"       </li>",
"       <li>",
"        Prevent ulcers from coming back",
"       </li>",
"       <li>",
"        Reduce the chance that an ulcer will get worse",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      It is important to follow all your doctors&rsquo; instructions about taking your medicines. Let your doctor or nurse know if you have any side effects or problems with your medicines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1480480786\">",
"      <span class=\"h1\">",
"       What happens after treatment?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After treatment, most people have follow-up tests to check that the H. pylori infection has gone away. Follow-up tests can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Breath tests",
"       </li>",
"       <li>",
"        Lab tests that check a sample of a bowel movement",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Most of the time, H. pylori infection is cured with treatment. But sometimes, H. pylori infection is not cured with treatment. People who still have H. pylori infection after being treated might need to take medicines for another 2 weeks.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1480480793\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
