"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 552px\">",
"   <div class=\"ttl\">",
"    Effect of short-acting barbiturate on electroencephalogram",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 532px; height: 357px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Intravenous administration of the short-acting agent, methohexital (Brevital&reg;), was followed by the appearance of high frequency (beta) activity. Electrical activity at more than 12 Hz is particularly prominent in the frontal, temporal, and parietal regions.",
"    <div class=\"footnotes\">",
"    </div>",
