"   </div>",
"   <div class=\"lgnd\">",
"    (A) Circumferential pelvic antishock sheeting is applied. The patient's clothing should be removed before application. The sheet is positioned beneath the patient's pelvis, being careful to avoid wrinkles that can create pressure sores. (B) The ends of the sheet are crossed in an overlapping manner anteriorly and (C) are pulled taut. (D) Clamps secure the smooth and snug sheet. The sheet pictured above is longer than that used in some instances; a sheet length limited to the pelvis is suitable.",
