"   <div class=\"block mop drugH1Div\" id=\"F8776892\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Assess efficacy of pain control, vital signs, and mental status; signs of drug abuse, addiction, or diversion",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Astramorph/PF&trade;, Duramorph, Infumorph: Patients should be observed in a fully-equipped and staffed environment for at least 24 hours following initiation, and as appropriate for the first several days after catheter implantation. Naloxone injection should be immediately available. Patient should remain in this environment for at least 24 hours following the initial dose. For patients receiving Infumorph via microinfusion device, patient may be observed, as appropriate, for the first several days after catheter implantation.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Note:",
"     </b>",
"     Also refer to institution specific protocols as appropriate.",
"    </p>",
"   </div>",
