"   <div class=\"block pha drugH1Div\" id=\"F8776768\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Binds to opioid receptors in the CNS, causing inhibition of ascending pain pathways, altering the perception of and response to pain; produces generalized CNS depression",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F8776772\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action (patient dependent; dosing must be individualized): Oral (immediate release): ~30 minutes; I.V.: 5-10 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration (patient dependent; dosing must be individualized): Pain relief:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Immediate release formulations: 4 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Extended release capsule and tablet: 8-24 hours (formulation dependent)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Variable",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : 1-6 L/kg; binds to opioid receptors in the CNS and periphery (eg, GI tract)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 20% to 35%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic via conjugation with glucuronic acid primarily to morphine-6-glucuronide (active analgesic) morphine-3-glucuronide (inactive as analgesic); minor metabolites include morphine-3-6-diglucuronide; other minor metabolites include normorphine (active) and morphine 3-ethereal sulfate",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: Oral: 17% to 33% (first-pass effect limits oral bioavailability; oral:parenteral effectiveness reportedly varies from 1:6 in opioid naive patients to 1:3 with chronic use)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Adults: Immediate release forms: 2-4 hours; Avinza&reg; ~24 hours;  Kadian&reg;:11-13 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, plasma: Avinza&reg;: 30 minutes (maintained for 24 hours); Kadian&reg;: ~10 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (primarily as morphine-3-glucuronide, ~2% to 12% excreted unchanged); feces (~7% to 10%). It has been suggested that accumulation of morphine-6-glucuronide might cause toxicity with renal insufficiency. All of the metabolites (ie, morphine-3-glucuronide, morphine-6-glucuronide, and normorphine) have been suggested as possible causes of neurotoxicity (eg, myoclonus).",
"    </p>",
"   </div>",
