var title_f19_31_19964="Warfarin maintenance dose adjustment";
var content_f19_31_19964=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F87435&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F87435&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Algorithm for adjustment of maintenance warfarin dosing based on the Randomized Evaluation of Long-term Anticoagulation Therapy (RE-LY) study",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup width=\"15%\">",
"     </colgroup>",
"     <colgroup width=\"85%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        INR",
"       </td>",
"       <td class=\"subtitle1\">",
"        Adjustment in total mg of warfarin per week",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &le;1.5",
"       </td>",
"       <td>",
"        Increase 15 percent per week",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1.51 to 1.99",
"       </td>",
"       <td>",
"        Increase 10 percent per week",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2 to 3",
"       </td>",
"       <td>",
"        No change",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3.01 to 4",
"       </td>",
"       <td>",
"        Decrease 10 percent per week",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4.01 to 4.99",
"       </td>",
"       <td>",
"        Hold one dose; restart with dose decreased by 10 percent per week",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5 to 8.99",
"       </td>",
"       <td>",
"        Hold until INR is 2 to 3; restart with dose decreased by 15 percent per week",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The table provides an algorithm for monitoring and adjustment of maintenance warfarin dosing with a goal of maintaining the INR between 2 and 3. This algorithm is not applicable to selecting a warfarin starting dose for warfarin na&iuml;ve patients or for adjusting the starting dose during the first week of warfarin treatment (refer to UpToDate topic on the use of warfarin for further information).",
"    <br>",
"     The maintenance dose algorithm requires that INR measurements are made at a maximum interval of every four weeks, with at least weekly monitoring for out of range INRs (&lt;2 or &gt;3).",
"     <br>",
"      All percent changes in warfarin dosage are adjusted based on the current INR value and calculated based upon the sum of the previous seven days of warfarin doses (also known as mg of warfarin per week). The increase or decrease in warfarin dose per week is distributed over the following week.",
"      <br>",
"       As an example, a patient taking 30 mg of warfarin per week with an INR of 1.8 would increase the dose by 10 percent (ie, 3 mg). The new weekly dose would be 33 mg, which could be distributed over the week as 5 mg daily on six days and 3 mg on the remaining day. Several alternate means of administering 33 mg per week could also be used, depending on which dose(s) of warfarin pills the patient had available. Based upon warfarin's mechanism of action, it is preferable to distribute doses as close to evenly as practical throughout the week.",
"       <div class=\"footnotes\">",
"        INR: international normalized ratio.",
"       </div>",
"       <div class=\"reference\">",
"        Data from: Van Spall HG, Wallentin L, Yusuf S, et al. Variation in warfarin dose adjustment practice is responsible for differences in the quality of anticoagulation control between centers and countries: an analysis of patients receiving warfarin in the randomized evaluation of long-term anticoagulation (RE-LY) trial. Circulation 2012; 126:2309.",
"       </div>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
