"   <div class=\"lgnd\">",
"    Vitamin A doses given as retinol activity equivalents (RAE). 1 RAE = 1 mcg retinol, 12 mcg beta-carotene, 14 mcg alpha-carotene, or 24 mcg beta-cryptoxanthin.",
"    <div class=\"footnotes\">",
"     <span style=\"color: #008000;\">",
"      RDA: recommended dietary allowance;",
"     </span>",
"     <span style=\"color: #ff0000;\">",
"      AI: adequate intake;",
"     </span>",
"     UL: upper tolerable level.",
"     <br/>",
"     * The RDA is the level of dietary intake that is sufficient to meet the daily nutrient requirements of 97 percent of the individuals in a specific life stage group.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     The AI represents an approximation of the average nutrient intake that sustains a defined nutritional state, based on observed or experimentally determined values in a defined population.",
"     <br/>",
"     &Delta; The UL is the maximum level of daily nutrient intake that is likely to pose no risk of adverse health effects in almost all individuals in the specified life-stage or gender group.",
